The error "property value expected" usually means that the CSS parser found a property (like `color:`) but didn't recognize the value that follows.

In your code:
```css
button.active label {
	font-size: 23px;
	color: @accent;
```
The issue is with `color: @accent;`. The `@accent` syntax is not valid in standard CSS; it's used in preprocessors like LESS or SASS for variables. If you're writing plain CSS, you need to use a valid color value (like `#ff0000`, `rgb(255,0,0)`, or a named color).

**How to fix:**
Replace `@accent` with a valid CSS color value. For example:
```css
button.active label {
	font-size: 23px;
	color: #0078d4; /* Example accent color */
}
```

If you want to use variables in CSS, use [CSS custom properties](https://developer.mozilla.org/en-US/docs/Web/CSS/Using_CSS_custom_properties):
```css
:root {
	--accent: #0078d4;
}

button.active label {
	font-size: 23px;
	color: var(--accent);
}
```

**Summary:**  
- `@accent` is not valid in plain CSS.
- Use a valid color value or CSS custom properties (`var(--accent)`).

